// Navbar.jsx
import React, { useState } from 'react';
import './NavbarHome.css';
import logo1 from '../assets/logo512.png';
import logo2 from '../assets/logo512.png';
import logo3 from '../assets/logo512.png';

const NavbarHome = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <nav className="navbar">
      {/* Logos en bas à gauche */}
      <div className="navbar-left">
        <div className="logos-container">
          <img src={logo1} alt="Logo 1" className="nav-logo" />
          <img src={logo2} alt="Logo 2" className="nav-logo" />
          <img src={logo3} alt="Logo 3" className="nav-logo" />
        </div>
      </div>

      {/* Menu à droite */}
      <div className="navbar-right">
        {/* Icône hamburger pour mobile */}
        <div 
          className={`menu-icon ${menuOpen ? 'open' : ''}`} 
          onClick={() => setMenuOpen(!menuOpen)}
        >
          <span></span>
          <span></span>
          <span></span>
        </div>

        {/* Menu principal */}
        <ul className={`nav-menu ${menuOpen ? 'active' : ''}`}>
          <li className="menu-item">Accueil</li>
          <li className="menu-item">Services</li>
          <li className="menu-item">Produits</li>
          <li className="menu-item">Contact</li>
        </ul>
      </div>
    </nav>
  );
};

export default NavbarHome;
